package com.t1t.util;

import org.junit.Test;
import org.slf4j.Logger;
import org.slf4j.LoggerFactory;

import static org.junit.Assert.assertTrue;

/**
 * Created by michallispashidis on 21/09/15.
 */
public class ImageSizeTest {
    private static Logger LOG = LoggerFactory.getLogger(ImageSizeTest.class.getName());
    private static String logoPart1 = "data:image/jpeg;base64,";
    private static String logoPart2 = "";
    private static String logoPart3 = "";

    @Test
    public void testImageSizeValidation() throws Exception {
        String logo = new StringBuilder(logoPart1)
                .append(logoPart2)
                .append(logoPart3)
                .toString();
        LOG.info("size=" + logo.getBytes().length);
        assertTrue(logo.getBytes().length <= 150_000L);

    }
}
